import React from "react";
import { Container, Nav, Navbar } from "react-bootstrap";
import { Link } from "react-router-dom";
import { useUser } from "./UserContext";

const HeaderAdmin = () => {
    const { user, handleLogOut } = useUser();

    return (
        <div>
            <Navbar expand="lg" className="bg-body-tertiary">
                <Container>
                    <Navbar.Brand href="#home">Manage User</Navbar.Brand>
                    <Navbar.Toggle aria-controls="basic-navbar-nav" />
                    <Navbar.Collapse className="mt-2" id="basic-navbar-nav">
                        <Nav className="me-auto">
                            <Link to="/listuser" className="text-base font-light text-gray-600 mr-2 " href="#home">
                                List User
                            </Link>
                            {!user.username ? (
                                <Link to="/signin" className="text-base font-light text-gray-600 cursor-pointer mx-4" href="#link">
                                    SignIn
                                </Link>
                            ) : null}
                            <Link to="/register" className="text-base font-light text-gray-600 cursor-pointer" href="#link">
                                Register
                            </Link>
                            <Link to="/shop" className="text-base font-light text-gray-600 cursor-pointe ml-2" href="#link">
                                shop
                            </Link>
                        </Nav>
                        {user.username ? (
                            <div className="block items-center">
                                <h5>! Hello {user.username}</h5>
                                <p className="ml-4 mt-2 cursor-pointer bg-black text-white p-2 rounded-xl text-xs" onClick={handleLogOut}>
                                    LogOut
                                </p>
                            </div>
                        ) : (
                            ""
                        )}
                    </Navbar.Collapse>
                </Container>
            </Navbar>
        </div>
    );
};

export default HeaderAdmin;
